import{_ as i,e as r,f as e,o as a}from"./app-CjPMRZj_.js";const l={};function n(c,t){return a(),r("div",null,t[0]||(t[0]=[e("h2",{id:"projectdescription",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#projectdescription"},[e("span",null,"projectDescription:")])],-1),e("p",null,"• 使用 Harmony 进行批次校正，并使用 SingleR/Seurat v5 进行细胞注释，对 scRNA-seq 数据（16个PDAC肿瘤，3个正常组织；16个PDAC PBMCs，4个健康PBMCs）进行预处理和聚类，以识别与 COL1A1 驱动的 ECM 重塑相关的 T 细胞空间塌陷和 TAM 扩增。 • 通过 Monocle3 对髓系-巨噬细胞谱系进行拟时序轨迹推断，揭示了 PDAC 来源的 TAM 中细胞毒性通路（GZMA/NKG7 下调）的表观遗传沉默和核糖体生物合成的上调。 • 使用 Squidpy + Scanpy 处理和分析 10x Xenium FFPE 空间转录组数据，随后使用 DESeq2 和 FindAllMarkers 进行差异表达基因（DEG）分析，并进行 GO/KEGG 富集分析以鉴定关键免疫调节因子。 • 鉴定出包括 NOP53（激活 p53，抑制 PI3K-AKT）和 SPP1（参与转移和抗肿瘤免疫）在内的双功能调节分子，并验证了它们与 TAM 和肿瘤细胞的空间共定位。",-1)]))}const s=i(l,[["render",n],["__file","article-1.html.vue"]]),m=JSON.parse('{"path":"/zh/research/article-1.html","title":"胰腺导管腺癌肿瘤相关巨噬细胞异质性与双功能分子节点的时空转录组分析","lang":"zh-CN","frontmatter":{"date":"06/2024-04/2025","layout":"ResearchPost","sort":0,"category":[1,"研究助理（远程）"],"title":"胰腺导管腺癌肿瘤相关巨噬细胞异质性与双功能分子节点的时空转录组分析","teacher":"由南加州大学Guangwei Zhang教授指导"},"headers":[{"level":2,"title":"projectDescription:","slug":"projectdescription","link":"#projectdescription","children":[]}],"git":{"updatedTime":1756009719000,"contributors":[{"name":"limengli","username":"limengli","email":"limengli@qq.com","commits":2,"url":"https://github.com/limengli"}],"changelog":[{"hash":"84a449896542c2afd785917d68f97d41e64b66fb","time":1756009719000,"email":"limengli@qq.com","author":"limengli","message":"update"},{"hash":"33fb064215db0208e223b56976bfe0fd34434077","time":1754478598000,"email":"limengli@qq.com","author":"limengli","message":"web"}]},"filePathRelative":"zh/research/article-1.md","excerpt":"<h2>projectDescription:</h2>\\n<p>• 使用 Harmony 进行批次校正，并使用 SingleR/Seurat v5 进行细胞注释，对 scRNA-seq 数据（16个PDAC肿瘤，3个正常组织；16个PDAC PBMCs，4个健康PBMCs）进行预处理和聚类，以识别与 COL1A1 驱动的 ECM 重塑相关的 T 细胞空间塌陷和 TAM 扩增。\\n• 通过 Monocle3 对髓系-巨噬细胞谱系进行拟时序轨迹推断，揭示了 PDAC 来源的 TAM 中细胞毒性通路（GZMA/NKG7 下调）的表观遗传沉默和核糖体生物合成的上调。\\n• 使用 Squidpy + Scanpy 处理和分析 10x Xenium FFPE 空间转录组数据，随后使用 DESeq2 和 FindAllMarkers 进行差异表达基因（DEG）分析，并进行 GO/KEGG 富集分析以鉴定关键免疫调节因子。\\n• 鉴定出包括 NOP53（激活 p53，抑制 PI3K-AKT）和 SPP1（参与转移和抗肿瘤免疫）在内的双功能调节分子，并验证了它们与 TAM 和肿瘤细胞的空间共定位。</p>"}');export{s as comp,m as data};
